import React from "react";
import { Link } from "react-router-dom";

const Clients = ({ posts }) => {
  return (
    <div>
      {posts.map((user, key) => (
        <Link
          className="dropdown-item"
          to={{
            pathname: `/update-user/${user._id}`,
          }}
        >
          User
        </Link>
      ))}
    </div>
  );
};

export default Clients;
